import { useState, useEffect } from 'react';
import './App.css';






function App() {

  const [counter, setCounter] = useState(0);

  useEffect( ()=> {
    console.log(counter);
  },[counter]);

  return (
    <div className="App">

      <button onClick={()=>{setCounter(counter-1);}}>-</button>
      <h1>{counter}</h1>
      <button onClick={()=>{setCounter(counter+1);}}>+</button>
    </div>

  );
}

export default App;

